import React, { Component } from 'react'

class ContactCreate extends Component{

    render() {
        return(
            <div>
                <h2>Create Contact</h2>
                <p>
                    <input type="text" name="name" placeholder="name"/>
                    <input type="text" name="amount" placeholder="name"/>
                </p>
                <button>Create</button>
            </div>
        )
    }

}

export default User;
